Expand and simplify completely: \begin{align*}
x\left(x(1+x)+2x\right)-3(x^2-x+2)
\end{align*}

answer:
To expand and simplify the given expression, we will follow the order of operations (PEMDAS):

\begin{align*}
x\left(x(1+x)+2x\right)-3(x^2-x+2) &= x\left(x+x^2+2x\right)-3x^2+3x-6\\
&= x\left(x^2+3x\right)-3x^2+3x-6\\
&= x^3+3x^2-3x^2+3x-6\\
&= x^3+3x-6
\end{align*}

So, the simplified expression is $x^3+3x-6$.

