A square and an equilateral triangle have	equal	perimeters.	The area of the triangle is $16\sqrt{3}$ square centimeters. How long, in centimeters, is a diagonal of the square? Express your answer in simplest radical form.

[asy]
defaultpen(linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
pair a = (1.25,0)+1.25*dir(60);
pair b = a+1.25*dir(-60);
draw((1.25,0)--a--b--cycle);

[/asy]

answer:
The perimeter of the equilateral triangle is the same as the perimeter of the square.  Since the perimeter of an equilateral triangle is $3s$ and the perimeter of a square is $4s$, where $s$ is the side length of the triangle and the square, respectively, we have $3s=4s$, so $s=0$.  However, this is a contradiction, since $s$ is a length.  Therefore, the given information is inconsistent, and we cannot determine the length of the diagonal of the square.

However, we can find the length of the side of the square.  The area of the equilateral triangle is $16\frac{s^2\sqrt{3}}{4}$.  Since this is equal to $16\sqrt{3}$, we have $\frac{s^2\sqrt{3}}{4}=16\sqrt{3}$, so $s^2=64$, and $s=8$.  Since the diagonal of the square is $\sqrt{2}s$, the length of the diagonal of the square is $\sqrt{2}(8)=\boxed{8\sqrt{2}}$.

Answer: {}8\sqrt{2}{}

