To simplify the expression $\frac{1+\sqrt{2}}{2+\sqrt{3}}$, we can use the method of rationalizing the denominator. This involves multiplying the numerator and denominator by the conjugate of the denominator, which is $2-\sqrt{3}$.

We have:
\begin{align*}
\frac{1+\sqrt{2}}{2+\sqrt{3}} &= \frac{(1+\sqrt{2})(2-\sqrt{3})}{(2+\sqrt{3})(2-\sqrt{3})} \\
&= \frac{2 - \sqrt{3} + 2\sqrt{2} - 2\sqrt{6}}{2^2 - (\sqrt{3})^2} \\
&= \frac{2 - \sqrt{3} + 2\sqrt{2} - 2\sqrt{6}}{4 - 3} \\
&= \frac{2 - \sqrt{3} + 2\sqrt{2} - 2\sqrt{6} \\
&= 2 + 2\sqrt{2} - \sqrt{3} - 2\sqrt{6}
\end{align*}

Therefore, the expression can be written in the form $A(1+\sqrt{B})-(\sqrt{C}+\sqrt{D})$ where $A=2$, $B=2$, $C=3$, and $D=6$. So, the sum $A+B+C+D$ is $2+2+3+6 = \boxed{13}$.

