\begin{pmatrix} a - 3b \\ c - 3d \end{pmatrix} &= \begin{pmatrix} 7 \\ -1 \end{pmatrix}.
\end{align*}

We can solve this system of equations to find the values of $a$, $b$, $c$, and $d$.

