To find the value of the product $abc$, we can use the fact that $(a+b+c)^2 = a^2 + b^2 + c^2 + 2ab + 2bc + 2ac$. We are given that $a+b=8$, $b+c=-3$, and $a+c=-5$. We can square these equations to get:

\begin{align*}
(a+b)^2 &= 64 \\
(b+c)^2 &= 9 \\
(a+c)^2 &= 25
\end{align*}

We can expand the squared equations to get:

\begin{align*}
a^2 + 2ab + b^2 &= 64 \\
b^2 + 2bc + c^2 &= 9 \\
a^2 + 2ac + c^2 &= 25
\end{align*}

We can add these equations together to get:

\begin{align*}
2(a^2 + b^2 + c^2) + 2(ab + bc + ac) &= 98
\end{align*}

We can divide both sides by 2 to get:

\begin{a^2 + b^2 + c^2 + ab + bc + ac = 49}

We can rearrange the terms to get:

\begin{align*}
