We are given that $p(n) = \frac{n}{n^2 - 1}$ for $n = 2,$ 3, 4, $\dots,$ 7.  We can write this as a system of equations:

\begin{align*}
p(2) &= \frac{2}{2^2 - 1} = \frac{2}{3},\\
p(3) &= \frac{3}{3^2 - 1} = \frac{3}{8},\\
p(4) &= \frac{4}{4^2 - 1} = \frac{4}{15},\\
p(5) &= \frac{5}{5^2 - 1} = \frac{5}{24},\\
p(6) &= \frac{6}{6^2 - 1} = \frac{6}{35},\\
\end{align*}

We can then use these values to find the polynomial $p(x)$.  We can write $p(x)$ as a linear combination of the functions $1$, $x$, $x^2$, $x^3$, and $x^4$.  Let $p(x) = a_0 + a_1x + a_2x^2 + a_3x^3 + a_4x^4$.  Then we have:

\begin{align*}
p(2) &= a_0 + 2a_1 + 4a_2 + 8a_3 + 16a_4 = \frac{2}{3},\\
p(3) &= a_0 + 3a_1 + 9a_2 + 27a_3 + 81a_4 = \frac{3}{8},\\
p(4) &= a_0 + 4a_1 + 16a_2 + 64a_3 + 256a_4 = \frac{4}{15},\\
p(5) &= a_0 + 5a_1 + 25a_2 + 125a_3 + 625a_4 = \frac{5}{24},\\
p(6) &= a_0 + 6a_1 + 36a_2 + 216a_3 + 1296a_4 = \frac{6}{35}.
\end{align*}

We can solve this system of equations using substitution or elimination to find the values of $a_0$, $a_1$, $a_2$, $a_3$, and $a_4$.

After solving the system of equations, we find that $p(x) = \frac{1}{24}x^4 - \frac{1}{2}x^3 + \frac{11}{6}x^2 - \frac{7}{2}x + 2$.

We can then find $p(8)$ by substituting $x = 8$ into the polynomial:

\begin{align*}
